# Eagle Declarative Streaming DSL

https://issues.apache.org/jira/browse/EAGLE-130
https://cwiki.apache.org/confluence/display/EAG/Dynamical+Monitoring+Framework
## DSL Format

```
{
    config {
      config.key = configValue
    }

    schema {
      metricStreamSchema {
        metric: string
        value: double
        timestamp: long
      }
    }

    dataflow {
      kafkaSource.source1 {
        schema = "metricStreamSchema"
      }
      kafkaSource.source2 {
        schema = {
          metric: string
          value: double
          timestamp: long
        }
      }
    }
}
```
## Usage

```
val pipeline = Pipeline.parseResource("pipeline.conf")
val stream = Pipeline.compile(pipeline)
stream.submit[storm]
```
## Features
- [x] Compile DSL Configure to Pipeline model
- [x] Compile Pipeline model to Stream Execution Graph
- [x] Submit Stream Execution Graph to actual running environment say storm
- [x] Support Alert and Persistence for metric monitoring
- [x] Pipeline runner CLI tool and shell script
- [x] Decouple pipeline compiler and scheduler into individual modules
- [x] Fix configuration conflict, should pass through Config instead of ConfigFactory.load() manually
- [x] Override application configuration with pipeline configuration
- [x] Supports `inputs` field to define connector
